INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('D.J. Caruso', '1965-01-17', 'Norwalk, Connecticut, USA', 'nm0142286', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg4NjgyODQ1M15BMl5BanBnXkFtZTYwMzA4Njg0._V1_.jpg', 'Born in Norwalk, Connecticut, Caruso came west to play tennis and study Television Production at Pepperdine University. Interned at Disney Studios in the Product Placement department and later hooked up with Director John Badham, who mentored him into a second-unit director, after Badham lost his 2nd-unit director Rob Cohen to a first-unit directing career.');
