INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('D.J. Caruso', '1965-01-17', 'Norwalk, Connecticut, USA', 'nm0142286', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg4NjgyODQ1M15BMl5BanBnXkFtZTYwMzA4Njg0._V1_.jpg', 'Born in Norwalk, Connecticut, Caruso came west to play tennis and study Television Production at Pepperdine University. Interned at Disney Studios in the Product Placement department and later hooked up with Director John Badham, who mentored him into a second-unit director, after Badham lost his 2nd-unit director Rob Cohen to a first-unit directing career.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Vin Diesel', '1967-07-18', 'Alameda County, California, USA', 'nm0004874', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjExNzA4MDYxN15BMl5BanBnXkFtZTcwOTI1MDAxOQ@@._V1_.jpg', 'Vin Diesel was born Mark Sinclair in Alameda County, California, along with his fraternal twin brother, Paul Vincent. He was raised by his astrologer/psychologist mother, Delora Sherleen (Sinclair), and adoptive father, Irving H. Vincent, an acting instructor and theater manager, in an artist\'s housing project in New York City\'s Greenwich Village.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Donnie Yen', '1963-07-27', 'Canton, China', 'nm0947447', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ3MzA0MDk0M15BMl5BanBnXkFtZTcwMTc2MjM1OQ@@._V1_.jpg', 'Martial artist and Hong Kong action star Donnie Yen was born to newspaper editor Klyster Yen and martial arts master Bow Sim Mark. At the age of four Yen started taking up martial arts from his mother, who taught him wushu and tai chi until the age of eleven when his family emigrated to Boston, MA.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Deepika Padukone', '1986-01-05', 'Copenhagen, Denmark', 'nm2138653', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNGFlYzAyYjgtNzRjNS00NmE4LTliOGYtYzBkYzU5MzRhMDM0XkEyXkFqcGdeQXVyMTExNDQ2MTI@._V1_.jpg', 'Deepika Padukone, born 5 January 1986 in Copenhagen, Denmark, is an Indian model & Actress. She is the daughter of former badminton Champion Prakash Padukone. Her mother tongue is Konkani. Deepika has a younger sister named Anisha.She has been modeling appearances in print and television advertising campaigns for Liril, Close-Up toothpaste and Limca, receiving many prestigious modeling offers, including brand ambassadorship of the Jewels of India, an annual jewelery exhibition.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kris Wu', '1990-11-06', 'Guangzhou, Guangdong, China', 'nm6806246', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU4NzEwNzUzN15BMl5BanBnXkFtZTgwNDAzMTE0NDE@._V1_.jpg', 'Kris Wu (Chinese name: Wu Yifan) is a Chinese-Canadian actor and singer-songwriter active in China. He has starred in several Chinese No.1 box office hits such as Somewhere Only We Know and Mr Six. Kris Wu was born Li Jiaheng (pinyin: Li Jiah√©ng) but he later changed his legal Chinese name to "Wu Yifan" for personal reasons.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Ruby Rose', '1986-03-20', 'Melbourne, Australia', 'nm3199307', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTcwOTg3NzgyNF5BMl5BanBnXkFtZTgwNzAyNDkyOTE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tony Jaa', '1976-02-05', 'Surin, Thailand', 'nm1388074', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg1NjE3NDcxMF5BMl5BanBnXkFtZTYwODU1Njg2._V1_.jpg', 'Japanom Yeerum was born on February 5, 1976, in the northeastern province of Surin, Thailand. His parents were elephant herders. Jaa watched martial arts films as a young kid and began to emulate some of his idols, from Bruce Lee to Jackie Chan to Jet Li.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Nina Dobrev', '1989-01-09', 'Sofia, Bulgaria', 'nm2400045', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTUwNjUwMTk1M15BMl5BanBnXkFtZTgwNDkyNDM2NDE@._V1_.jpg', 'Nikolina "Nina" Constantinova Dobreva was born in Sofia, Bulgaria. She moved to Canada at the age of two and has lived in Toronto, Ontario ever since. From a very young age, she showed great enthusiasm and talent for the arts: Dance, Gymnastics, Theatre, Music, Visual arts, and Acting! Modeling jobs led to commercials, which then turned into film auditions.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Rory McCann', '1969-04-24', 'Glasgow, Scotland, UK', 'nm0564920', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkxODk5MTUwMV5BMl5BanBnXkFtZTgwNDEwMTgxNDE@._V1_.jpg', 'Six foot six inches tall, with brown eyes and dark hair, Rory McCann from Glasgow began his working life at the top - as a painter on the Forth Bridge in Scotland. He came to notice in a television commercial for Scotts\' Porridge Oats, in which he appeared as a scantily-clad hunk in a vest and kilt and little else wandering snowbound streets but warmed by the inner glow of the porridge.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Toni Collette', '1972-11-01', 'Sydney, New South Wales, Australia', 'nm0001057', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjEwNDU0MjQ3MV5BMl5BanBnXkFtZTcwMzgwMjMxMw@@._V1_.jpg', 'Toni Collette is an Academy Award-nominated Australian actress, best known for her roles in "The Sixth Sense" and "Little Miss Sunshine".Collette was born Toni Collett (she later added an "e") on November 1, 1972, in Blacktown, Sydney, New South Wales, Australia.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Samuel L. Jackson', '1948-12-21', 'Washington, District of Columbia, USA', 'nm0000168', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ1NTQwMTYxNl5BMl5BanBnXkFtZTYwMjA1MzY1._V1_.jpg', 'Samuel L. Jackson is an American producer and highly prolific actor, having appeared in over 100 films, including "Die Hard with a Vengeance", "Unbreakable", "Shaft", "The 51st State", "Black Snake Moan", "Snakes on a Plane", and the Star Wars prequel trilogy (1999-2005), as well as the Marvel Cinematic Universe.');
