INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Al Sapienza', '1956-07-31', 'New York City, New York, USA', 'nm0002326', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjExNTQ3MDMzNF5BMl5BanBnXkFtZTgwNDgxOTg2NDE@._V1_.jpg', 'Al Sapienza was born in New York City. Started studying music at the age of eight. Got hit with the acting bug when he was twelve. Five months after graduating NYU he landed a role in the Broadway musical "Beatlemania". Stayed in that show for five years and headed out to Los Angeles.');
