INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Alex Armbruster', 'Unknown', '', 'nm4675100', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg5OTIwNTM5NF5BMl5BanBnXkFtZTcwODM0NDA5Nw@@._V1_.jpg', 'Alex Armbruster was born near Vancouver, BC, Canada and is a stunt performer/actor working mainly out of Toronto and Montreal, Canada. He is an extreme sports enthusiast and does live rollerblade/bmx shows around the globe in his spare time. He loves to rollerblade, surf, wakeboard, climb, ski, snowboard, and do parkour.');
